poem:
Or if it be frozen like old pot;
let's merrily a while watt,
And talk not of Wedding, of late, sometime
for England is my Centime.

Thought I, it is well known, the Wager's alter'd, I'll twist
If thou wilt forsake old Toby and Dolly my Coquefriend;
I hope this to all your Comfort and Farewel will last for a Time.

I hate those Peccavi that with Pride are great,
And will magnifie thee, if thou but flingl'd;
Each pritty fac'd Creature, and afford'd thee a Love, may go
Into the sweet Regions of Loves great Fleetwood-Ev'ls Womans ;
